  render() {
    return (
      <div>
        <div>image div</div>
    {/* <div>{this.state.staticPictureList[0]}</div> */}


        {/* <img
          style={{ height: "200px", width: "200px" }}
          src="/images/washing-hands.png"
        /> */}

{/* <img
          style={{ height: "200px", width: "200px" }}
          src={this.state.staticPictureList[0].src}
          alt="no image available"
        /> */}

        <img
          style={{ height: "200px", width: "200px" }}
          src={this.state.imageList[this.state.index]}
          alt="no image available"
        />
      </div>
    );
  }
}

export default PictureBar;
